window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"24.1.0","implementation":{"version":"10.6.0","name":"cucumber-js"},"cpu":{"name":"x64"},"os":{"name":"darwin","version":"21.6.0"},"runtime":{"name":"node.js","version":"21.7.0"}}},{"source":{"data":"Feature: Crear page\n\n    @run @pages\n    Scenario: escenario_1 - Crear una page con un título y un audio\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Pages\"\n        And doy click en \"New page\"\n        And ingreso \"Page de prueba\" como nombre de la página\n        And agrego un audio a la página\n        When publico la página\n        Then la página debe existir en la lista\n        And el audio se agregó correctamente\n\n    @run @pages @v3 @debug\n    Scenario: escenario_2 - Crear una page con un título, un párrafo y un video embebido de YouTube\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Pages\"\n        And doy click en \"New page\"\n        And ingreso \"Página de prueba YT\" como nombre de la página\n        And ingreso \"contenido de la página con link a youtube\" como contenido de la página\n        And agrego un video embebido de YouTube con link \"https://www.youtube.com/watch?v=edVYLVDDgh0\"\n        When publico la página\n        Then abro la sección de \"Pages\"\n        And la página debe existir en la lista\n        And el video se agregó correctamente\n\n    @run @pages @v3 @debug\n    Scenario: escenario_3 - Crear una page básica con una URL definida (slug)\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Pages\"\n        And doy click en \"New page\"\n        And ingreso \"Page de prueba con slug\" como nombre de la página\n        And abro las configuraciones de la página\n        And cambio el slug de la página por \"slug-de-prueba\"\n        And cierro las configuraciones de la página\n        When publico la página\n        Then abro la sección de \"Pages\"\n        And la página debe existir en la lista\n        And puedo navegar a la URL con el slug asignado\n\n    @run @pages @v3\n    Scenario: escenario_4 - Crear una page básica, previsualizarla y dejarla en borrador\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Pages\"\n        And doy click en \"New page\"\n        And ingreso \"Page de prueba con preview\" como nombre de la página\n        And ingreso \"contenido de la página con preview\" como contenido de la página\n        When ingreso a la previsualización\n        Then puedo previsualizar correctamente la página\n        And salgo de la previsualización\n        When guardo el borrador de la página\n        Then la página debe existir en la lista\n        And la página debe tener el estado \"Draft\"","uri":"step_definitions_v3/features/crear-page.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Crear page","description":"","children":[{"scenario":{"id":"0b4a6d97-c07a-46df-a6e6-6dafaaa22465","tags":[{"location":{"line":3,"column":5},"name":"@run","id":"268f3312-5ba4-4727-b91e-6e393f57b208"},{"location":{"line":3,"column":10},"name":"@pages","id":"9593d677-8217-46e1-822c-8ac4b920f132"}],"location":{"line":4,"column":5},"keyword":"Scenario","name":"escenario_1 - Crear una page con un título y un audio","description":"","steps":[{"id":"b20cdafb-0142-41b5-a741-212507672e45","location":{"line":5,"column":9},"keyword":"Given ","keywordType":"Context","text":"inicio la aplicación"},{"id":"65035930-8bc6-4723-be58-b3d9d562d119","location":{"line":6,"column":9},"keyword":"And ","keywordType":"Conjunction","text":"inicio sesión si es necesario"},{"id":"97cd4adc-c652-4420-a700-199530b05ef3","location":{"line":7,"column":9},"keyword":"And ","keywordType":"Conjun dos tags tienen slug diferente\n\n    @run @tags\n    Scenario: escenario_3 - Crear tag con una imagen\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Tags\"\n        And doy click en \"New tag\"\n        And ingreso \"Tag de prueba con imagen\" como nombre del tag\n        And ingreso \"Descripción de tag de prueba\" como descripción del tag\n        And agrego una imagen al tag\n        When guardo el tag\n        Then el tag se guarda exitosamente\n        And abro la sección de \"Tags\"\n        And el tag se encuentra en la lista\n        And abro la página del tag\n        And el tag debe tener la imagen\n\n\n    @run @tags @v3\n    Scenario: escenario_4 - Crear tag con Meta Data\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Tags\"\n        And doy click en \"New tag\"\n        And ingreso \"Tag de prueba con imagen\" como nombre del tag\n        And ingreso \"Descripción de tag de prueba\" como descripción del tag\n        And ingreso datos de meta data con título \"Metatitulo\" y descripción \"MetaDesc\"\n        When guardo el tag\n        Then el tag se guarda exitosamente\n        And abro la sección de \"Tags\"\n        And el tag se encuentra en la lista\n        And abro la página del tag\n        And el tag debe contener la información de meta data\n","uri":"step_definitions_v3/features/crear-tag.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Crear Tag","description":"","children":[{"scenario":{"id":"03301395-296c-464e-b348-a6fec1744cc7","tags":[{"location":{"line":3,"column":5},"name":"@run","id":"7b83fcfc-639b-4a5b-8eb9-56392da42ae5"},{"location":{"line":3,"column":10},"name":"@tags","id":"99a7673a-2a1c-4258-81de-3f62a79bc362"},{"location":{"line":3,"column":16},"name":"@v3","id":"5aec8a51-65c7-4  sesión\n        And inicio sesión con la contraseña \"PRUEBAS123456\"\n        And debo entrar a la página de inicio\n        And abro la sección de \"Profile\"\n        And abro el diálogo de cambio de contraseña\n        And ingreso las contraseñas para restablecer\n        And guardo el cambio de contraseña\n\n    @run @profile\n    Scenario: escenario_2 - Cambiar imagen de cover a 8K\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Profile\"\n        And agrego una imagen de cover de 8K\n        When guardo mi perfil\n        Then navego a Home\n        And abro la sección de \"Profile\"\n        And la imagen debe estar en el perfil\n        And elimino la imagen\n        And guardo mi perfil\n\n\n    @run @profile\n    Scenario: escenario_3 - Cambiar correo electrónico y nombre\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Profile\"\n        And cambio mi nombre a \"Equipo 20 - 2024\"\n        And cambio mi correo a \"equipo2024@misw4103.com\"\n        When guardo mi perfil\n        Then navego a Home\n        And abro la sección de \"Profile\"\n        And el nombre debe corresponder al nuevo\n        And el correo debe corresponder al nuevo\n        And cambio el nombre y el correo a los originales\n        And guardo mi perfil\n\n    @run @profile\n    Scenario: escenario_4 - Anclar los perfiles de redes sociales (facebook y X - twitter)\n        Given inicio la aplicación\n        And inicio sesión si es necesario\n        And abro la sección de \"Profile\"\n        And cambio mi usuario de Facebook a \"Equipo20\"\n        And cambio mi usuario de Twitter a \"TwEquipo20\"\n        When guardo mi perfil\n        Then navego a Home\n        And abro la sección de \"Profile\"\n        And el usuario de Facebook debe corresponder al nuevo\n        And el usuario de Twitter debe corresponder al nuevo\n        And vacio mi usuario d
